import React from 'react';
import './App.css';
import cat1 from './cats.jpg'
import cat from "./flower_cat.jpg"
/*

const sleep = (ms) =>
    new Promise(resolve => setTimeout(resolve, ms));

function FormattedDate(props) {
    return <h2>It is {props.date.toLocaleTimeString()}.</h2>;
}

class Clock extends React.Component {
    constructor(props) {
        super(props);
        this.state = {date: new Date(), beg_date: new Date()};
    }

    componentDidMount() {
        this.timerID = setInterval(
            () => this.tick(),
            1000
        );
    }

    componentWillUnmount() {
        clearInterval(this.timerID);
    }

    tick() {
        this.setState({
            date: new Date()
        });
    }

    render() {

        return (

            <div>
                <h1>Hello, world!</h1>
                <FormattedDate date={this.state.date} />
            </div>
        );
    }
}

function App() {
    return (
        <div>
            <Clock />
        </div>
    );
}

//ReactDOM.render(<App />, document.getElementById('root'));
*/
function App() {
    return (
        <div className="App">
            <header className="App-header">
                <div className="poster">
                    <img src={cat} className="poster_cat" alt="image of cat"/>
                    <p className="poster_text">ADOPT US. </p>
                    <p className="poster_text2">WE NEED YOUR HELP.</p>
                </div>
                <div className="Adoption-page">
                    <p class='Intro'>
                        Cats Available for Adoption
                    </p>
                    <div className="List_of_cats">
                <span className="list_el">
                      <img src={cat1}  alt="image of cat"/>
                </span>
                    </div>
                </div>
            </header>
        </div>
    );
}

export default App;
